import React from 'react';
import './styles.css';
import { BiMoon } from 'react-icons/bi';
import { FaRegLightbulb } from 'react-icons/fa';
import contextProvider from '../context/contextProvider';
const CardComponent = () => {
	const { dark } = React.useContext(contextProvider);
	console.log(dark);
	return (
		<>
			<h3>Switch theme</h3>
			<button>
				<BiMoon style={{ fontSize: 20 }} />
				<FaRegLightbulb style={{ fontSize: 20, marginLeft: 12 }} />
			</button>
		</>
	);
};

export default CardComponent;
